"""Proteins are chains of amino acids just as nucleic acids are polymers of nucleotides.
There are 20 amino acids that commonly appear in every species.
Primary structure of proteins is the order of its amino acids.
Some proteins are composed of several subchains called polypeptides, while others are formed of a single polypeptide e.g. Human Hemoglobin molecule has 4 polypeptide chains (2 alpha, 2 beta).

The key to understanding life lies in interpreting the relationship between a chain of amino acids and the function of the protein that this chain of amino acids eventually constructs.

Key Terms in Molecular Biology and Translation:

-Proteomics is the field devoted to the study of proteins.
-messenger RNA (mRNA) is an RNA copy of a gene that carries coding information from DNA to the ribosome, where it serves as a template for building proteins.
-Translation is the process of decoding the mRNA sequence into a chain of amino acids. The ribosome reads codons in order, and tRNAs deliver matching amino acids to build a polypeptide.
-Codons are groups of three RNA bases that act as coded instructions for which amino acid to add during protein synthesis.
-Start codon (AUG) or the first codon recognized during translation; it signals where to begin reading the mRNA and codes for the amino acid methionine (Met).
-Stop codons (UAA, UAG, UGA) are sequences in mRNA that do not code for an amino acid but instead mark the end of translation, causing the ribosome to release the finished protein.

-The Central Dogma of Molecular Biology describes the general flow of genetic information --> DNA is transcribed into RNA, and RNA is translated into protein. This captures how genes direct the production of cellular machinery, though a few exceptions exist.
-A ribosome is a complex of RNA and proteins that carries out translation by reading mRNA codons and linking amino acids together in sequence.
-transfer RNA (tRNA) is a small RNA molecule that brings amino acids to the ribosome. Each tRNA has an anticodon region that pairs with a matching codon on the mRNA.
-The anticodon is a set of three bases on a tRNA that pairs with a complementary codon on the mRNA, ensuring the correct amino acid is added.
-A gene is a segment of DNA that contains the information needed to produce a specific RNA or protein product.
-Heredity is the passing of genetic traits or information from one generation to the next through DNA."""

